import React from 'react';

interface FeedbackDashboardProps {
  results: {
    transcript: string;
    metrics: {
      fillerWords: number;
      speakingRateWpm: number;
    };
    questionAnalysis?: Array<{
      questionNumber: number;
      question: string;
      answer: string;
      starMethod: boolean;
      relevance: number;
      feedback: string;
    }>;
    summary: string;
    decision: {
      pass: boolean;
      rationale: string;
    };
  };
}

const FeedbackDashboard: React.FC<FeedbackDashboardProps> = ({ results }) => {
  const { transcript, metrics, questionAnalysis, summary, decision } = results;

  // Parse transcript to extract Q&A pairs
  const parseTranscript = (transcript: string) => {
    const lines = transcript.split('\n').filter(line => line.trim());
    const qaPairs = [];

    for (let i = 0; i < lines.length; i += 2) {
      if (lines[i]?.startsWith('Q') && lines[i + 1]?.startsWith('A')) {
        const question = lines[i].replace(/^Q\d+:\s*/, '');
        const answer = lines[i + 1].replace(/^A\d+:\s*/, '');
        qaPairs.push({
          questionNumber: Math.floor(i / 2) + 1,
          question,
          answer
        });
      }
    }

    return qaPairs;
  };

  const qaPairs = parseTranscript(transcript);

  return (
    <div className="space-y-6">
      <div className="bg-white rounded-lg shadow-lg p-6">
        <h2 className="text-2xl font-semibold mb-4">Interview Analysis Results</h2>

        {/* Overall Decision */}
        <div className={`rounded-lg p-4 mb-6 ${decision.pass ? 'bg-green-50 border border-green-200' : 'bg-red-50 border border-red-200'}`}>
          <h3 className={`text-lg font-semibold ${decision.pass ? 'text-green-800' : 'text-red-800'}`}>
            {decision.pass ? '✅ Pass' : '❌ Needs Improvement'}
          </h3>
          <p className={`text-sm mt-1 ${decision.pass ? 'text-green-700' : 'text-red-700'}`}>
            {decision.rationale}
          </p>
        </div>

        {/* Summary */}
        <div className="mb-6">
          <h3 className="text-lg font-semibold mb-2">Summary</h3>
          <p className="text-gray-700">{summary}</p>
        </div>

        {/* Key Metrics */}
        <div className="grid md:grid-cols-2 gap-6 mb-6">
          <div className="bg-gray-50 rounded-lg p-4">
            <h3 className="font-semibold mb-3">Voice Analysis</h3>
            <div className="space-y-2">
              <div className="flex justify-between">
                <span>Filler Words:</span>
                <span className="font-medium">{metrics.fillerWords}</span>
              </div>
              <div className="flex justify-between">
                <span>Speaking Rate:</span>
                <span className="font-medium">{metrics.speakingRateWpm} WPM</span>
              </div>
            </div>
          </div>
        </div>

        {/* Per-Question Analysis */}
        <div className="mb-6">
          <h3 className="text-lg font-semibold mb-4">Question-by-Question Analysis</h3>
          <div className="space-y-4">
            {qaPairs.map((qa, index) => (
              <div key={index} className="border rounded-lg p-4">
                <div className="flex items-start justify-between mb-3">
                  <h4 className="font-semibold text-indigo-600">Question {qa.questionNumber}</h4>
                  <div className="flex gap-2">
                    <span className={`px-2 py-1 rounded text-xs font-medium ${
                      questionAnalysis?.[index]?.starMethod ? 'bg-green-100 text-green-800' : 'bg-red-100 text-red-800'
                    }`}>
                      {questionAnalysis?.[index]?.starMethod ? 'STAR ✓' : 'STAR ✗'}
                    </span>
                    <span className={`px-2 py-1 rounded text-xs font-medium ${
                      (questionAnalysis?.[index]?.relevance || 0) >= 70 ? 'bg-green-100 text-green-800' : 'bg-yellow-100 text-yellow-800'
                    }`}>
                      Relevance: {questionAnalysis?.[index]?.relevance || 0}%
                    </span>
                  </div>
                </div>

                <div className="mb-3">
                  <p className="text-sm text-gray-600 mb-1">Question:</p>
                  <p className="text-gray-800">{qa.question}</p>
                </div>

                <div className="mb-3">
                  <p className="text-sm text-gray-600 mb-1">Your Answer:</p>
                  <p className="text-gray-800">{qa.answer}</p>
                </div>

                {questionAnalysis?.[index]?.feedback && (
                  <div className="bg-blue-50 rounded p-3">
                    <p className="text-sm text-blue-800">
                      <strong>Feedback:</strong> {questionAnalysis[index].feedback}
                    </p>
                  </div>
                )}
              </div>
            ))}
          </div>
        </div>

        {/* Full Transcript */}
        <div>
          <h3 className="text-lg font-semibold mb-3">Complete Transcript</h3>
          <div className="bg-gray-50 rounded-lg p-4">
            <pre className="whitespace-pre-wrap text-sm text-gray-700">{transcript}</pre>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FeedbackDashboard;
